import { useNavigate } from 'react-router-dom';

function LogoutButton() {
  const navigate = useNavigate();

  const handleLogout = () => {
    // Limpia todo lo relacionado al login
    localStorage.removeItem("user");
    localStorage.clear(); // Si quieres borrar todo, incluyendo otros datos
    sessionStorage.clear(); // Si usaste sessionStorage también

    // Redirige al login
    navigate('/login');
  };

  return (
    <button onClick={handleLogout} className="btn-logout">
      Cerrar sesión
    </button>
  );
}

export default LogoutButton;
